import "./App.css";
import { useState, useCallback } from "react";

function App() {
  const [message, setMessage] = useState("");

  useCallback(() => {
    const getData = async () => {
      await fetch(
        "/api"({
          str: "value",
        })
      );
    };
    getData();
  }, []);

  return <div className="App"></div>;
}

export default App;
